import React, { useState, useEffect } from "react";
import Select from "react-select";
import { FixedSizeList as List } from "react-window";
import { useLocation } from 'react-router-dom';
import FetchStockDataForCode from "../ComponentsFetch/FetchStockDataForCode";
import FetchStockList from "../ComponentsFetch/FetchStockList";
import FetchLatestStockData from "../ComponentsFetch/FetchLatestStockData";
import ChartOfClose from "../ComponentsChart/ChartOfClose";
import ChartOfRSI from "../ComponentsChart/ChartOfRSI";
import ChartOfMACD from "../ComponentsChart/ChartOfMACD";
import ChartOfADX from "../ComponentsChart/ChartOfADX";
import ChartOfSAR from "../ComponentsChart/ChartOfSAR";
import ChartOfMFI from "../ComponentsChart/ChartOfMFI";
import ChartOfKeltner from "../ComponentsChart/ChartOfKeltner";
import ChartOfCCI from "../ComponentsChart/ChartOfCCI";
import ChartOfIchimoku from "../ComponentsChart/ChartOfIchimoku";
import RSIAnalysis1 from "../ComponentsAnalysis/RSIAnalysis1";
import RSIAnalysis2 from "../ComponentsAnalysis/RSIAnalysis2";
import RSIAnalysis3 from "../ComponentsAnalysis/RSIAnalysis3";
import RSIAnalysis4 from "../ComponentsAnalysis/RSIAnalysis4";
import RSIAnalysis5 from "../ComponentsAnalysis/RSIAnalysis5";
import RSICalculations1 from "../ComponentsCalculations/RSICalculations1";
import MACDAnalysis1 from "../ComponentsAnalysis/MACDAnalysis1";
import MACDAnalysis2 from "../ComponentsAnalysis/MACDAnalysis2";
import MACDAnalysis3 from "../ComponentsAnalysis/MACDAnalysis3";
import MACDAnalysis4 from "../ComponentsAnalysis/MACDAnalysis4";
import MACDAnalysis5 from "../ComponentsAnalysis/MACDAnalysis5";
import ADXAnalysis1 from "../ComponentsAnalysis/ADXAnalysis1";
import ADXAnalysis2 from "../ComponentsAnalysis/ADXAnalysis2";
import ADXAnalysis3 from "../ComponentsAnalysis/ADXAnalysis3";
import ADXAnalysis4 from "../ComponentsAnalysis/ADXAnalysis4";
import SARAnalysis1 from "../ComponentsAnalysis/SARAnalysis1";
import SARAnalysis2 from "../ComponentsAnalysis/SARAnalysis2";
import SARAnalysis3 from "../ComponentsAnalysis/SARAnalysis3";
import SARAnalysis4 from "../ComponentsAnalysis/SARAnalysis4";
import MFIAnalysis1 from "../ComponentsAnalysis/MFIAnalysis1";
import MFIAnalysis2 from "../ComponentsAnalysis/MFIAnalysis2"
import MFIAnalysis3 from "../ComponentsAnalysis/MFIAnalysis3";
import MFIAnalysis4 from "../ComponentsAnalysis/MFIAnalysis4";
import CCIAnalysis1 from "../ComponentsAnalysis/CCIAnalysis1"
import CCIAnalysis2 from "../ComponentsAnalysis/CCIAnalysis2"
import CCIAnalysis3 from "../ComponentsAnalysis/CCIAnalysis3"
import CCIAnalysis4 from "../ComponentsAnalysis/CCIAnalysis4"
import KeltnerAnalysis1 from "../ComponentsAnalysis/KeltnerAnalysis1";
import KeltnerAnalysis2 from "../ComponentsAnalysis/KeltnerAnalysis2";
import KeltnerAnalysis3 from "../ComponentsAnalysis/KeltnerAnalysis3";
import KeltnerAnalysis4 from "../ComponentsAnalysis/KeltnerAnalysis4";
import IchimokuAnalysis1 from "../ComponentsAnalysis/IchimokuAnalysis1";
import IchimokuAnalysis2 from "../ComponentsAnalysis/IchimokuAnalysis2";
import IchimokuAnalysis3 from "../ComponentsAnalysis/IchimokuAnalysis3";
import IchimokuAnalysis4 from "../ComponentsAnalysis/IchimokuAnalysis4";
import Navbar from "../components/Navbar";
import './Detail.css';
import '../styles/LinkText.css';
import FetchRSIData from "../ComponentsFetch/FetchRSIData";

const MenuList = ({ options, children, maxHeight, getValue }) => {
    const height = 35;
    const [value] = getValue() || [];
    const initialOffset = value ? options.findIndex(option => option.value === value) * height : 0;

    return (
        <List
            height={maxHeight}
            itemCount={children.length}
            itemSize={height}
            initialScrollOffset={initialOffset}
        >
            {({ index, style }) => (
                <div style={style}>
                    {children[index]}
                </div>
            )}
        </List>
    );
};

function Detail() {
    const location = useLocation();
    const initialStockCode = location.state?.stockCode || "";
    const initialStockName = location.state?.stockName || "";
    const [stockData, setStockData] = useState([]);
    const [stockList, setStockList] = useState([]);
    const [latestData, setLatestData] = useState([]);
    const [rsiData, setRsiData] = useState([]);
    const [availableStocks, setAvailableStocks] = useState([]);
    const [selectedStock, setSelectedStock] = useState({ value: initialStockCode, label: initialStockName });
    const [filteredData, setFilteredData] = useState([]);
    const [activeTab, setActiveTab] = useState(null);
    const [inputValue, setInputValue] = useState("");

    const handleLatestStockData = (data) => {
        setLatestData(data);
    };

    const handleDataFetch = (data) => {
        setStockData(data);
    };

    const handleRsiDataFetch = (data) => {
        setRsiData(data);
    };

    const handleListFetch = (data) => {
        setStockList(data);
    };

    const handleTabClick = (tab) => {
        setActiveTab(tab);
    };

    useEffect(() => {
        if (stockData.length > 0 && stockList.length > 0) {
            const available = stockList.filter(code => latestData.stock_code === code.stockCode)
                .map(stock => ({
                    value: stock.code,
                    label: `${stock.name}`
                }));
            setAvailableStocks(available);
        }
    }, [stockData, stockList, latestData]);

    useEffect(() => {
        if (stockData.length > 0 && selectedStock) {
            const filtered = stockData.sort((b, a) => new Date(a.date) - new Date(b.date));
            setFilteredData(filtered);
        }
    }, [stockData, selectedStock]);

    const handleSelectChange = (selectedOption) => {
        setSelectedStock(selectedOption);
    };

    const customStyles = {
        option: (provided) => ({
            ...provided,
            whiteSpace: 'nowrap',
            fontSize: '14px',
            overflow: 'hidden',
            textOverflow: 'ellipsis',
            height: '2.1em',
        }),
        container: (provided) => ({
            ...provided,
            width: '450px'
        })
    };

    return (
        <>
            <Navbar />

            <div className="detail-container">
                <div className="search-bar">
                    <Select
                        components={{ MenuList }}
                        options={availableStocks}
                        onChange={handleSelectChange}
                        value={selectedStock}
                        placeholder="종목을 검색하세요"
                        styles={customStyles}
                        inputValue={inputValue}
                        onInputChange={(value) => setInputValue(value)}
                    />
                </div>

                <div className="indicator-tabs">
                    <button className={activeTab === 'RSI' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('RSI')}>RSI
                    </button>
                    <button className={activeTab === 'MFI' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('MFI')}>MFI
                    </button>
                    <button className={activeTab === 'CCI' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('CCI')}>CCI
                    </button>
                    <button className={activeTab === 'MACD' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('MACD')}>MACD
                    </button>
                    <button className={activeTab === 'ADX' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('ADX')}>ADX
                    </button>
                    <button className={activeTab === 'Parabolic SAR' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('Parabolic SAR')}>Parabolic SAR
                    </button>
                    <button className={activeTab === 'Keltner Channel' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('Keltner Channel')}>Keltner Channel
                    </button>
                    <button className={activeTab === 'Ichimoku Cloud' ? 'active-tab' : ''}
                            onClick={() => handleTabClick('Ichimoku Cloud')}>Ichimoku Cloud
                    </button>
                </div>

                <div className="detail-main-content">
                    <div className="detail-chart">
                        <FetchStockDataForCode stockCode={selectedStock.value} onSDFCFetch={handleDataFetch}/>
                        <FetchRSIData stockCode={selectedStock.value} onRSIFetch={handleRsiDataFetch}/>
                        <FetchStockList onListFetch={handleListFetch}/>
                        <FetchLatestStockData onLSDFetch={handleLatestStockData}/>

                        {selectedStock && (
                            <>
                                <h3 className="detail-chart-text">{selectedStock.label} 차트</h3>

                                {activeTab !== "ADX" && activeTab !== "MACD" && activeTab !== "RSI" && activeTab !== "CCI" &&activeTab !== "Parabolic SAR" && activeTab !== "Keltner Channel" &&
                                    activeTab !== "Ichimoku Cloud" && activeTab !== "MFI" && (
                                    <ChartOfClose stockCode={selectedStock.value}/>
                                )}

                                {activeTab === "RSI" && (
                                    <ChartOfRSI stockCode={selectedStock.value}/>
                                )}
                                {activeTab === "MACD" && (
                                    <ChartOfMACD stockCode={selectedStock.value}/>
                                )}
                                {activeTab === "ADX" && (
                                    <ChartOfADX stockCode={selectedStock.value}/>
                                )}
                                {activeTab === "Parabolic SAR" && (
                                    <ChartOfSAR stockCode={selectedStock.value}/>
                                )}
                                {activeTab === "MFI" && (
                                    <ChartOfMFI stockCode={selectedStock.value} />
                                )}
                                {activeTab === "CCI" && (
                                    <ChartOfCCI stockCode={selectedStock.value} />
                                )}
                                {activeTab === "Keltner Channel" && (
                                    <ChartOfKeltner stockCode={selectedStock.value} />
                                )}
                                {activeTab === "Ichimoku Cloud" && (
                                    <ChartOfIchimoku stockCode={selectedStock.value} />
                                )}
                            </>
                        )}
                    </div>

                    <div className="analysis-display">
                        <h3 className="analysis-display-main-text">{selectedStock.label} 분석</h3>

                        {/* Conditionally render analysis based on availability of data */}
                        {activeTab === "RSI" && rsiData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <RSIAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <RSIAnalysis2 stockCode={selectedStock.value} stockData={stockData} rsiData={rsiData}/>
                                </div>
                                <div className="textbox">
                                    <RSIAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <RSIAnalysis4 rsiData={rsiData}/>
                                </div>
                                <div className="textbox">
                                    <RSIAnalysis5 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <RSICalculations1 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}

                        {activeTab === "MACD" && stockData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <MACDAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MACDAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MACDAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MACDAnalysis4 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MACDAnalysis5 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}

                        {activeTab === "ADX" && stockData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <ADXAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <ADXAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <ADXAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <ADXAnalysis4 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}
                        {activeTab === "Parabolic SAR" && stockData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <SARAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <SARAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <SARAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <SARAnalysis4 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}
                        {activeTab === "MFI" && stockData.length > 0 && (
                            <>
                            <div className="textbox">
                                    <MFIAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MFIAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MFIAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <MFIAnalysis4 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}
                        {activeTab === "CCI" && stockData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <CCIAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <CCIAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <CCIAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <CCIAnalysis4 stockCode={selectedStock.value}/>
                                </div>

                            </>
                        )}
                        {activeTab === "Keltner Channel" && stockData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <KeltnerAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <KeltnerAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <KeltnerAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <KeltnerAnalysis4 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}
                        {activeTab === "Ichimoku Cloud" && stockData.length > 0 && (
                            <>
                                <div className="textbox">
                                    <IchimokuAnalysis1 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <IchimokuAnalysis2 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <IchimokuAnalysis3 stockCode={selectedStock.value}/>
                                </div>
                                <div className="textbox">
                                    <IchimokuAnalysis4 stockCode={selectedStock.value}/>
                                </div>
                            </>
                        )}
                    </div>
                </div>

                <div className="detail-table">
                    <h3>{selectedStock ? selectedStock.label : "종목"} 종목 데이터</h3>
                    <table>
                        <thead>
                            <tr>
                                <th>일자</th>
                                <th>종가</th>
                                <th>고가</th>
                                <th>저가</th>
                                <th>시가</th>
                                <th>거래량</th>
                            </tr>
                        </thead>
                        <tbody>
                            {filteredData.map((data, index) => (
                                <tr key={index}>
                                    <td>{data.date}</td>
                                    <td>{data.close}</td>
                                    <td>{data.high}</td>
                                    <td>{data.low}</td>
                                    <td>{data.open}</td>
                                    <td>{data.volume}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </>
    );
}

export default Detail;
